import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import { Navigation, Pagination, Autoplay } from 'swiper/modules';
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import img1 from '../assets/Home img1.jpg';
import img2 from '../assets/Home img2.jpeg';
import img3 from '../assets/Home img3.jpg';
import '../styles/Home.css';

const Home = () => {
  return (
    <div>
    <div className='home-container'>
      <div className='home-left'>
        <>Welcome</>
        <p>The Roofings will give you a high quality ceramics, tiles and whatever you want</p>
        <button className='home-btn'>Get Started</button>
      </div>
      <div className='home-right'>
        <Swiper
          modules={[Navigation, Pagination, Autoplay]}
          spaceBetween={50}
          slidesPerView={1}
          navigation
          pagination={{ clickable: true }}
          autoplay={{ delay: 3000 }}
        >
          <SwiperSlide><img src={img1} alt="Slide 1" /></SwiperSlide>
          <SwiperSlide><img src={img2} alt="Slide 2" /></SwiperSlide>
          <SwiperSlide><img src={img3} alt="Slide 3" /></SwiperSlide>
        </Swiper>
      </div>
    </div>
    
    </div>
  );
};

export default Home;
